import React, { Component } from 'react';
import NavbarItem from './NavbarItem';

class Navbar extends Component {
  render() {
    const NavbarTitles = {
      titles: ['Pokemons', 'Types'],
    };

    return (
      <div>
        NavbarTitles.map((item) => (<NavbarItem title={this.item.titles} />
        ))
      </div>
    );
  }
}

export default Navbar;
